--
-- Name: sp_voto_lista_rector(); Type: FUNCTION; Schema: public_auditoria; Owner: postgres
--

CREATE FUNCTION public_auditoria.sp_voto_lista_rector() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
				DECLARE
					schema_temp varchar;
					rtabla_usr RECORD;
					rusuario RECORD;
					vusuario VARCHAR(60);
					voperacion varchar;
					vid_solicitud integer;
					vestampilla timestamp;
				BEGIN
					vestampilla := current_timestamp;
					SELECT INTO schema_temp public.recuperar_schema_temp();
					SELECT INTO rtabla_usr * FROM pg_tables WHERE tablename = 'tt_usuario' AND schemaname = schema_temp;
					IF FOUND THEN
						SELECT INTO rusuario usuario, id_solicitud FROM tt_usuario;
						IF FOUND THEN
							vusuario := rusuario.usuario;
							vid_solicitud := rusuario.id_solicitud;
						ELSE
							vusuario := user;
							vid_solicitud := 0;
						END IF;
					ELSE
						vusuario := user;
					END IF;
					IF (TG_OP = 'INSERT') OR (TG_OP = 'UPDATE') THEN
						IF (TG_OP = 'INSERT') THEN
							voperacion := 'I';  
						ELSE
							voperacion := 'U';
						END IF;
					ELSIF TG_OP = 'DELETE' THEN
						voperacion := 'D';
					END IF;
					RETURN NULL;
				END;
			$$;


